shaders.vertex:
// default vertex shader

attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
  vTexCoord = aTexCoord;
  gl_Position = aVertex;
}

shaders.fragment:
// default fragment shader

// texture coordinate (0;0)..(1;1)
varying vec4 vTexCoord;
// texture
uniform sampler2D uTexture;
// elapsed time since program start in seconds (with fractions)
uniform float uT;
// width by height of texture
uniform vec2 uResolution;
// mouse position within range of uResolution
uniform vec2 uMouse;
// list of positions marked by via Alt+MouseLeft
uniform vec2 uMarks[];
// number of marks in uMarks[]
uniform int uMarksCount;



void main(void)
{
  vec4 color;
  vec2 mouse = uMouse / uResolution;
  vec2 uv = vTexCoord.st;
  if (uv.x < mouse.x) {
    if (uv.y > mouse.y) {
      color = texture2D(uTexture, vTexCoord.st);
    }
    else if (uv.y > 0.65) {
      color = texture2D(uTexture, vTexCoord.st + vec2(0.05, 0.0)) * vec4(0.8, 1.0, 0.2, 1.0);
    }
    else if (uv.y > 0.35) {
      color = texture2D(uTexture, vTexCoord.st + vec2(-0.04, 0.0)) * vec4(0.8, 0.0, 0.2, 1.0);
    }
    else {
      color = texture2D(uTexture, vTexCoord.st + vec2(-0.02, 0.0)) * vec4(0.1, 0.9, 0.2, 1.0);
    }
  }
  else {
    float grey = dot(vec3(0.3, 0.8, 0.2), texture2D(uTexture, vTexCoord.st).rgb);
    color = vec4(grey, grey, grey, 1.0);
  }
  gl_FragColor = color;
}
